import React, { useEffect, useState } from 'react'

function OutputSearchItem(props) {
    const [item,setItem] = useState()
  useEffect(()=>{
if(props.item){
    setItem(props.item)
}
  },[])
    return (
    
<div className='outputSearch'>
            <div>
                <p>Category</p>
            <p>{item&&item.category}</p>
                </div>
           <div>
           <p>Name</p>
           <p>{item&&item.name}</p>
            </div>
            <div>
            <p>Price</p>
            <p>{item&&item.price}$</p> 
                </div>
        </div>  )
}

export default OutputSearchItem
